const calcGrowthModifier = ({ growthProgress, growthModifiers }) => {
  for (let i = 0; i < growthModifiers.length; i++) {
    if (growthProgress < growthModifiers[i].maxGrowthProgress) {
      return growthModifiers[i].growthModifier;
    }
  }

  return growthModifiers[growthModifiers.length - 1].growthModifier;
};

module.exports = calcGrowthModifier;
